var question = []; // create empty array

// create question objects and store them in the array
question[0] = { 
     questionText: "What shape of car do you like?",
     answers:
          [
               { response: "Big", nextQuestion: 1 },
               { response: "Big", nextQuestion: 1 },
               { response: "Small", nextQuestion: 2 }
          ]
};
question[1] = { 
     questionText: "You like big cars? Where do you like driving?",
     answers:
          [
               { response: "City", nextQuestion: 3 },
               { response: "Country", nextQuestion: 4 }
          ]
};
question[2] = { 
     questionText: "You like small cars? How many skateboards do you own?",
     answers:
          [
               { response: "0", nextQuestion: 5 },
               { response: "1+", nextQuestion: 6 }
          ]
};

export default question;
